import React, { useEffect, useState } from 'react';
import "@radix-ui/themes/styles.css";
import { Button, Flex, Text } from '@radix-ui/themes';

interface PaginationButtonsProps {
  currentPage: number;
  totalPages: number;
  onPrevious: () => void;
  onNext: () => void;
  hasPrevious: boolean;
  hasNext: boolean;
}

const PaginationButtons: React.FC<PaginationButtonsProps> = ({ 
  currentPage, 
  totalPages, 
  onPrevious, 
  onNext, 
  hasPrevious, 
  hasNext 
}) => { 
{/* Catie - shoq only if there are next pages */}
return (
    <Flex justify="end" align="end" gap="2" p="2">
      <Button 
        onClick={onPrevious} 
        disabled={!hasPrevious}
      >
        Previous
      </Button>

      <Text size="2" style={{ margin: "0 8px" }}>
        Page {currentPage} of {totalPages}
      </Text>

      <Button 
        variant={hasNext ? 'solid' : 'outline'} 
        color={hasNext ? 'blue' : 'gray'} 
        onClick={onNext} 
        disabled={!hasNext}
      >
        <Text style={{ color: hasNext ? "white" : "var(--gray-12)" }}>
          Next
        </Text>
      </Button>
    </Flex>
  );
};

export default PaginationButtons;
